import { Breadcrumb, Icon } from 'antd'

type BreadcrumbItem = {
  icon?: string
  link?: string
  text: string
}

type BreadcrumbProps = {
  nav: [BreadcrumbItem]
}

export const NavBreadcrumb = (props: BreadcrumbProps) => {
  const { nav } = props
  return (
    <Breadcrumb>
      {nav.map(n => (
        <Breadcrumb.Item href={n.link}>
          {n.icon && <Icon type={n.icon} />}
          <span>{n.text}</span>
        </Breadcrumb.Item>
      ))}
    </Breadcrumb>
  )
}
